import React from 'react';

const Card = ({contry}) => {
    return (
        <li className="card">
            <img src={contry.flags.Svg} alt="drapeau"/>
            <div className="infos">
                <h2>Nom du pays</h2>
            </div>
        </li>
    );
};

export default Card;
